import React from "react";
import "./User.css";

function User() {
  return (
    <div className="user">
      <img src="./images/avatar.jpeg" alt="" />
      <h1 className="user__name">Ibrahima BA</h1>
      <p className="user__proffession">Technicien en Electronique</p>
      <div className="user__infos">
        <p className="user__info">
          62 rue des Vanniers 31270 Villeneuve Tolosane
        </p>
        <p className="user__info">
          <a href="tel:+33370368414">0670368414</a>
        </p>
        <p className="user__info">
          <a href="mailto:iba@2evt.fr">iba@2evt.fr</a>
        </p>
        <p className="user__info">Date de naissance : 14 Octobre 1982</p>
        <p className="user__info">Lieu de naissance : Dondou - Sénégal</p>
      </div>
    </div>
  );
}

export default User;
